<!DOCTYPE html>
<meta charset="utf-8">
<title>Redirecting to https://jnthnhrrr.github.io/</title>
<script type="text/javascript">
  const newURL = "https://jnthnhrrr.github.io"
  const currentPath = new URL(window.location.href).pathname
  window.location.href = newURL + currentPath
</script>
<link rel="canonical" href="https://jnthnhrrr.github.io/">
